import React from "react";
import Create from "./component/Create";
import "./index.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Read from "./component/read";
function App()
{
    return(
        <BrowserRouter>
            <Routes>
                <Route path="/create" element= {<Create />}/>
                <Route path="/" element={<Read />} />
            </Routes>
        </BrowserRouter>
       
    )
}
export default App;
